import "./conversationScreen.css";
import "./usersList.css";
import { useState, useEffect } from "react";
function UsersList() {
  const [clients, setClients] = useState(false);
  const [coachs, setCoachs] = useState(false);
  const [sup, setSup] = useState(false);
  function ChooseClient() {
    useEffect(() => {
      setClients(true);
      setCoachs(false);
      setSup(false);
      console.log(clients);
    }, [])
  }
  function ChooseCoach() {
    useEffect(() => {
      setClients(false);
      setCoachs(true);
      setSup(false);
      console.log(coachs);
    }, [])
  }
  function ChooseSup() {
    useEffect(() => {
      setClients(false);
      setCoachs(false);
      setSup(true);
      console.log(sup);
    }, [])
  }

  return (
    <div className="usersListWrapper">
      <div className="usersType">
        <div onClick={useEffect(() => {
      setClients(!clients);
      console.log(clients);
    }, [clients])}>
          <div className={clients ? "clicked" : "type"}>Clients</div>
        </div>
        <div className={`${coachs ? "clicked" : "type"}`} onClick={useEffect(() => {
      
      setCoachs(!coachs);
      
      console.log(coachs);
    }, [])}>
          Coachs
        </div>
        <div className={sup ? "clicked" : "type"} onClick={useEffect(() => {
      
      setSup(!sup);
      console.log(sup);
    }, [])}>
          Superviseurs
        </div>
      </div>
    </div>
  );
}
export default UsersList;
